import React, {Component} from 'react'
import {connect} from 'react-redux'

class taskList extends Component{
    constructor(){
        super()
    }

    state = {
        item: [
            {
                id: 1,
                due: 'no due date',
                text: 'do this'
            },
            {
                id: 2,
                due: 'no due date',
                text: 'do that'
            },
            {
                id: 3,
                due: 'april 1st',
                text: 'do them'
            }
        ]
    }

    render(){
        return(
            <div>
                <h2>{this.state.item.due}</h2>
                <ul>
                    {this.state.item.map(
                        item =>
                        <li key={item.id}>
                            <input type="checkbox" value={item.id}> {item.text} </input>
                        </li>
                    )}
                </ul>
            </div>
        );
    }
}

const mapToStateProps = (state) => {
    return{
        item: state.todo
    }
}
export default taskList
